let totalCollected = 0;
let totalRequests = 0;
let totalErrors = 0;
const startTime = Date.now();

function sleep(ms) { return new Promise(r => setTimeout(r, ms)); }

async function fetchPage(cursor, workerId, sortOrder = 'Asc') {
    const params = { sortOrder: sortOrder, limit: 100 };
    if (cursor) params.cursor = cursor;
    const proxyUrl = PROXIES[workerId % PROXIES.length];
    const agent = new HttpsProxyAgent(proxyUrl, { rejectUnauthorized: false });
    let cookie = null;
    if (COOKIES.length > 0) {
        const entry = COOKIES[workerId % COOKIES.length];
        const parts = entry.split(':');
        cookie = `.ROBLOSECURITY=${parts.length >= 3 ? parts.slice(2).join(':') : entry}`;
    }
    const headers = {
        'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/120.0.0.0 Safari/537.36',
        'Accept': 'application/json',
        'Referer': `https://www.roblox.com/games/${PLACE_ID}`,
        'Origin': 'https://www.roblox.com',
    };
    if (cookie) headers['Cookie'] = cookie;
    try {
        totalRequests++;
        const resp = await axios.get(BASE_URL, {
            params,
            httpsAgent: agent,
            timeout: 30000,
            headers
        });
        console.log(`[W${workerId}] Status: ${resp.status} | Servers: ${resp.data.data.length}`);
        return resp.data;
    } catch (e) {
        totalErrors++;
        if (e.response && e.response.status === 429) {
            console.log(`[W${workerId}] Rate limited  sleeping 5s`);
            await sleep(5000);
        } else {
            console.log(`[W${workerId}] Error: ${e.message}`);
        }
        return null;
    }
}

async function scrapeAllPages(workerId, sortOrder = 'Asc') {
    const collected = [];
    let cursor = null;
    let page = 0;
    while (page < 200) {
        const data = await fetchPage(cursor, workerId, sortOrder);
        if (!data || !data.data) break;
        for (const server of data.data) {
            if (server.id) collected.push(server.id);
        }
        cursor = data.nextPageCursor;
        page++;
        if (!cursor) break;
        await sleep(REQUEST_DELAY);
    }
    return collected;
}

async function updatePool(ids) {
    const pipeline = redis.pipeline();
    ids.forEach(id => pipeline.sadd('job_pool', id).expire('job_pool', 300));  // 5min TTL
    const results = await pipeline.exec();
    const added = results.reduce((sum, [err, res]) => sum + (res[1] === 1 ? 1 : 0), 0);  // Count new adds
    totalCollected += added;
    return added;
}

async function worker(workerId) {
    await sleep(workerId * 150);
    const sortOrder = workerId % 2 === 0 ? 'Asc' : 'Desc';
    console.log(`[W${workerId}] Starting (${sortOrder})`);
    while (true) {
        const start = Date.now();
        const ids = await scrapeAllPages(workerId, sortOrder);
        const added = await updatePool(ids);
        const elapsed = ((Date.now() - start) / 1000).toFixed(1);
        console.log(`[W${workerId}] Found ${ids.length} IDs | +${added} new | Took ${elapsed}s | Pool: ${await redis.scard('job_pool')}`);
        await sleep(POLL_INTERVAL);
    }
}

// HTTP Server Endpoints
const server = http.createServer(app);
app.use((req, res, next) => {
    res.setHeader('Access-Control-Allow-Origin', '*');
    res.setHeader('Access-Control-Allow-Methods', 'GET, POST, OPTIONS');
    res.setHeader('Access-Control-Allow-Headers', '*');
    if (req.method === 'OPTIONS') {
        res.writeHead(204);
        res.end();
        return;
    }
    next();
});

app.get('/get-id', async (req, res) => {
    const id = await redis.srandmember('job_pool');
    if (id) {
        res.send(id);
    } else {
        // Trigger fallback in background
        console.log('Pool low - triggering fallback scrape');
        for (let i = 0; i < WORKERS; i++) {
            worker(i);
        }
        res.status(204).send();
    }
});

app.post('/submit-ids', async (req, res) => {
    const { ids } = req.body;
    if (!ids || !Array.isArray(ids)) return res.status(400).send('Invalid IDs');
    const added = await updatePool(ids);
    res.json({ added });
});

app.get('/pool-stats', async (req, res) => {
    const size = await redis.scard('job_pool');
    res.json({ size, totalCollected, totalRequests, totalErrors });
});

